from django.db import models


# Create your models here.
class Hobbies(models.Model):

    def __str__(self):
        return self.hobby_name

    hobby_name = models.CharField(max_length=200)
    hobby_desc = models.CharField(max_length=200)
    hobby_image = models.CharField(max_length=500,
                                   default="data:image/jpeg;base64,")


class Portfolio(models.Model):

    def __str__(self):
        return self.port_name

    port_name = models.CharField(max_length=200)
    port_desc = models.CharField(max_length=200)
    port_image = models.CharField(max_length=500,
                                  default="data:image/jpeg;base64,")
    port_website = models.URLField(max_length=500, default="https://github.com/WillLantz")


class ContactUs(models.Model):
    Name = models.CharField(max_length=50)
    Email = models.EmailField(max_length=100)
    Comment = models.TextField(max_length=500)